import React from "react";

export default function ResumeSkills() {
  return (
    <div className="resume-skills">
      <h4>Skills</h4>
      <ul>
        <li>Javascript</li>
        <li>React</li>
        <li>TypeSCript</li>
        <li>Node.js</li>
        <li>Tailwind CSS</li>
        <li>SQL</li>
      </ul>
      <hr className="divider" />
    </div>
  );
}
